import React from 'react'

const Profile =()=>{
    return(
        <div style={{maxWidth:"550px",margin:"0px auto"}}>
           <div style={{
              margin:"18px 0px",
               borderBottom:"1px solid grey"
           }}>
               <div style={{
               display:"flex",
               justifyContent:"space-around",

               }}>
                <div>
                    <img  src="https://images.unsplash.com/photo-1552985247-03b1fddb53d1?ixid=MXwxMjA3fDB8MHxzZWFyY2h8NDB8fHBlcnNvbnxlbnwwfDJ8MHw%3D&ixlib=rb-1.2.1&auto=format&fit=crop&w=500&q=60" style={{width : "160px",height:"160px",borderRadius:"80px"}} />
                </div>
                <div>
                    <h4>Lucky rai</h4>
                    <div style={{display:"flex" ,justifyContent:"space between",width:"108px" }}>
                        <h5>40 posts</h5>
                        <h5>40 followers</h5>
                        <h5>40 likes</h5>
                    </div>
               </div>
            </div>
            </div>
            </div>
    )
}
export default Profile;
